var ruRU={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Одобрить","Allow in your wallet":"Разрешите в своём кошельке","Allow {symbol} first":["Сначала разрешить ",["symbol"]],"Allowance pending":"Разрешение подтверждается","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Произошла ошибка при попытке произвести этот обмен. Возможно, нужно увеличить допустимое проскальзывание. Если это не сработает, возможно, имеет место несовместимость с токеном, которым вы торгуете. Обратите внимание: токены с комиссией за перевод или изменяемой базой несовместимы с Uniswap V3.","Approval pending":"Одобрение подтверждается","Approve":"Одобрить","Approve Permit2":"Approve Permit2","Approve in your wallet":"Одобрите в своём кошельке","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Сначала одобрить ",["symbol"]],"Auto":"Авто","Auto Router":"Автомаршрутизатор","Auto Router API":"API автомаршрутизатора","Balance:":"Баланс:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Закрыть","Confirm in your wallet":"Подтвердите в своём кошельке","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Подключить кошелёк","Connecting…":"Подключение…","Continue":"Continue","Convert {0} to {1}":["Конвертировать ",["0"]," в ",["1"]],"Convert {0} to {1} with no slippage":["Конвертировать ",["0"]," в ",["1"]," без проскальзывания"],"Disconnect wallet":"Отключить кошелек","Dismiss":"Закрыть","Enter an amount":"Введите сумму","Error fetching trade":"Ошибка при получении сделки","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Получение лучшей цены…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Высокое проскальзывание увеличивает риск изменения цены","I don't have a wallet":"у меня нет кошелька","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Баланс ",["0"]," недостаточен"],"Invalid recipient":"Неверный получатель","Max":"Максимум","Max slippage":"Максимальное проскальзывание","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Отсутствуют зависимости","Network fee":"Плата за сеть","No results found.":"Ничего не найдено.","No tokens are available on this network. Please switch to another network.":"В этой сети нет доступных токенов. Пожалуйста, переключитесь на другую сеть.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Пожалуйста, введите корректный процент проскальзывания","Powered by the Uniswap protocol":"Работает по протоколу Uniswap","Price impact":"Влияние на цену","Price updated":"Цена обновлена","Reload":"Reload","Reload the page":"Перезагрузить страницу","Request rejected":"Request rejected","Review swap":"Проверьте обмен","Search by token name or address":"Поиск токена по имени или адресу","Select token":"Выберите токен","Show less":"Show less","Show more":"Show more","Something went wrong":"Что-то пошло не так","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Успешно","Swap":"Обменять","Swap failed: {0}":["Обмен не удался: ",["0"]],"Switch network":"Переключить сеть","Switch network in your wallet":"Переключите сеть в своем кошельке","Switching network":"Коммутационная сеть","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Инвариант Uniswap x * y = k не соблюдается при обмене. Обычно это означает, что один из токенов, которые вы обмениваете, имеет особенности поведения при его передаче.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"Сумма, которую вы ожидаете получить по текущей рыночной цене. Вы можете получить меньше или больше, если рыночная цена изменится, пока ваша транзакция подтверждается.","The estimated difference between the USD values of input and output amounts.":"Приблизительная разница между стоимостью токенов к продаже и к получению в долларах США.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"Влияние вашей сделки на рыночную цену этого пула.","The input token cannot be transferred. There may be an issue with the input token.":"Невозможно перевести токен к продаже. Возможно, имеется проблема с этим токеном.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Невозможно перевести токен к получению. Возможно, имеется проблема с токеном к получению.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Невозможно перевести токен к получению. Возможно, имеется проблема с токеном к получению. Обратите внимание: токены с комиссией за перевод или изменяемой базой несовместимы с Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Эта транзакция не будет успешной из-за движения цены. Попробуйте увеличить допустимое проскальзывание. Обратите внимание: токены с комиссией за перевод или изменяемой базой несовместимы с Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Эта транзакция не будет успешной из-за движения цены или комиссии за перевод. Попробуйте увеличить допустимое проскальзывание.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Cрок действия транзакции","Transaction rejected":"Транзакция отклонена","Transaction submitted":"Транзакция отправлена","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Попробуйте увеличить допустимое проскальзывание.<0/>ВНИМАНИЕ: токены с комиссией за перевод или изменямой базой несовместимы с Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Неожиданная ошибка. Невозможно спрогнозировать газ для обмена.","Unexpected issue with estimating the gas. Please try again.":"Неожиданная проблема при прогнозировании газа. Пожалуйста, попробуйте еще раз.","Use the Uniswap Labs API to get faster quotes.":"Использовать API от Uniswap Labs, чтобы быстрее получать котировки.","View on Etherscan":"Посмотреть на Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Предупреждение","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Ваша транзакция откатится, если её подтверждение займёт больше указанного времени.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Ваша транзакция откатится, если цена изменится не в вашу пользу более, чем на этот процент.","minutes":"минут(-ы)","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":["Комиссия ",["integrator"]],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { ruRU as default };
